import React from "react"

function Footer() {
  return (
    <footer>
      Developed by <b>Aleksander Gralewski</b>, 2020
      <i class="fab fa-github"></i>
      <i class="fab fa-linkedin-in"></i>
    </footer>
  )
}

export default Footer
